import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function Team() {
  const [team, setTeam] = useState([]);

  useEffect(() => {
    // Backend se team data fetch kiya
    axios.get('http://localhost:5000/api/team')
      .then(res => setTeam(res.data))
      .catch(err => console.error(err));
  }, []);

  return (
   <section className="our-team container-fluid py-5 px-4">
  <div className="text-center mb-4">
    <h2>Our Team</h2>
    <div className="blue-line mx-auto"></div>
  </div>
  <div className="row justify-content-center gx-4">
    <div className="col-12 col-sm-6 col-md-4 col-lg-4 mb-4 d-flex">
      <div className="team-card">
        <img src="img/img_tim.png" alt="Team Member 1" />
        <div className="name">John Doe</div>
        <div className="designation">Project Manager</div>
      </div>
    </div>
    <div className="col-12 col-sm-6 col-md-4 col-lg-4 mb-4 d-flex">
      <div className="team-card">
        <img src="img/img_maria.png" alt="Team Member 2" />
        <div className="name">Maria Sharapova</div>
        <div className="designation">Lead Developer</div>
      </div>
    </div>
    <div className="col-12 col-sm-6 col-md-4 col-lg-4 mb-4 d-flex">
      <div className="team-card">
        <img src="img/img_roger.png" alt="Team Member 3" />
        <div className="name">Mike Johnson</div>
        <div className="designation">UI/UX Designer</div>
      </div>
    </div>
  </div>
</section>

  );
}
